import React, { useState } from 'react';
import Header from './Header';
import DocumentList from './DocumentList';
import FormContainer from './FormContainer';  // Ensure this component is correctly imported
import Result from './Result';
import './styles.css';  // Ensure this is the correct path to your stylesheet

function App() {
  const [selectedDocument, setSelectedDocument] = useState(null);

  return (
    <div>
      <Header />
      <div className="container">
        <DocumentList onDocumentSelect={setSelectedDocument} />
        <FormContainer selectedDocument={selectedDocument} />
        <Result />
      </div>
    </div>
  );
}

export default App;
